  const { loading, data } = useQuery(FETCH_POST_QUERY);
  if (data) {
    console.log(data);
  }
  return <div>
    Home
  </div>;
}

const FETCH_POST_QUERY = gql`{
  getPosts{
    id body createdAt username likeCount
    likes{
      username
    }
    commentCount
    comments{
      id username createdAt body
    }
  }
}`;

export default Home;
